import React from "react";
// import logo from './studentcomputer.png'
import { Link } from "react-router-dom";
class Nav extends React.Component {
  render() {
    return (
      <div>
        <nav>
          {/* <img src={logo} alt="studentwithcomputer"/> */}
          <ul>
            <Link to="/dashboard">
              <li className="na">Dashboard</li>
            </Link>
            <Link to="/student">
              <li>Student</li>
            </Link>
          </ul>
        </nav>
      </div>
    );
  }
}

export default Nav;
